function CardCovid(props) {
    const { cardcovid } = props;
    return(
        <div className={styles.pasien}>
            <h2 className={styles.pasien__status}>{car.status}</h2>
            <h3 className={styles[cardcovid.status]}>{car.total}</h3>
        </div>
    );
}

export default CardCovid;
